('', '', 0, 0, 0, 'gugent', 'gugent', 'adverb', 'avverbio', 'volentieri', 'volentieri', 'bugen', 'bugen', 'bugent', 'bugent', 'gugent', 'gugent', 'gugent', 'gugent', 'gugent, jent', 'gugent, jent', 'Gugent:\nusato spesso anche con il verbo \"avair\" significa anche \"avere volentieri\", espressione inesistente in italiano\nEsempi(1):\nJau hai tai gugent = ti amo, ti voglio bene, mi piaci.\n(2) Jau fatsch gugent pensums = io faccio volentieri i compiti (mi piace fare i compiti).\n(3) Jau nod gugent = io nuoto volentieri (mi piace nuotare).', 'La traducziun taliana pli dusada da \"gugent\" es \"volentieri\" Exempel: \"vost alch da mangiar? Gugent grazia\" = \"vuoi qualcosa da mangiare? Volentieri grazie\" ', '', '', '', 353),
