('', '', 0, 0, 0, 'ura', 'ura', 'num feminin', 'nome femminile', 'ora', 'ora', 'ura', 'ura', 'ura', 'ura', 'oura', 'oura', 'ura', 'ura', 'ura', 'ura', 'Tempo:\nsignificato identico della parola italiana \"ora\".\n\"Peda\" è usato per il tempo disponibile.\n\"Avair peda\" significa avere tempo che cresce per fare qualcosa.\nN.B. il detto: \"I dat bain umans che han ina massa temp, mo nagina peda.\" = \"ci sono persone che hanno troppo tempo ma non hanno tempo (inteso come tempo reale a disposizione per fare qualcosa).\"', '', '', '', '', 357),
