('', '', 0, 0, 0, 'vegnir, daventar', 'vegnir, daventar', 'verb', 'verbo', 'diventare', 'diventare', 'vegnir, daventar', 'vegnir, daventar', 'vagnir, daventar', 'vagnir, daventar', 'davantar, neir', 'davantar, neir', 'dvanter', 'dvanter', 'dvantar', 'dvantar', 'Verbi romanci (1):\nVerbi irregolari:\nUno di questi è \"vegnir\".\nClicca \"Dettagli\" per visualizzare la sua coniugazione completa.\n----------\nVegnir:\nil verbo \"vegnir\" è molto usato in Romancio.\n(1) Venire (moto a luogo)\n(2) Diventare \n(3) Utilizzato cone in parte dell\'italiano nelle frasi passive \"viene investito dalla macchina\"\n(4) Utilizzato come ausiliare per il fututo (vegnir + infinito) in Rumantsch Grischun e in tre altri romanci (Vallader e Puter hanno un tempo verbale futuro indeclinabile, Surmiran li ha entrambi)', '', '', 'VEGNIR \n\nPreschent: \njau vegn\nti vegns\nel/ella/ins vegn\nnus vegnin\nvus vegnis\nels/ellas vegnan \n\nFutur:\njau vegn a vegnir \nti vegns a vegnir \nel/ella/ins vegn a vegnir \nnus vegnin a vegnir \nvus vegnis a vegnir \nels/ellas vegnan a vegnir \n\nImperfect: \njau vegniva\nti vegnivas\nel/ella/ins vegniva\nnus vegnivan\nvus vegnivas\nels/ellas vegnivan \n\nParticip perfect: \nvegnì (f: vegnida, mpl: vegnids, fpl: vegnidas)\n\nPerfect:\nJau sun vegnì/ vegnida\nTi es vegnì/ vegnida\nel/ella/ins è vegnì/vegnida\nnus essan vegnids/vegnidas\nvus essas vegnids/vegnidas\nels/ellas èn vegnids/vegnidas\n\nCundiziunal: \njau vegniss\nti vegnissas\nel/ella/ins vegniss\nnus vegnissan\nvus vegnissas\nels/ellas vegnissan \n\nConjunctiv: \nche jau vegnia\nche ti vegnias\nch\'el/ella/ins vegnia\nche nus vegnian\nche vus vegnias\nch\'els/ellas vegnian \n\nImperativ: \nve!\nvegni! \n\nGerundi: \nvegnind ', '', 1781),
