('', '', 0, 0, 0, 'encreschadetgna', 'encreschadetgna', 'num feminin', 'nome femminile', 'nostalgia', 'nostalgia', 'encarschadetgna', 'encarschadetgna', 'ancarschadetgna, carschadetgna', 'ancarschadetgna, carschadetgna', 'ancreschadetna, malancuneia', 'ancreschadetna, malancuneia', 'increschantüna', 'increschantüna', 'increschantüm', 'increschantüm', 'Nostalgia:\nLa nostalgia di casa è radicata nel cuore della cultura romancia e si riflette in numerosi scritti e canzoni.\nChiedere ai viaggiatori se non vedono l\'ora di tornare a casa o se hanno nostalgia è parte rilevante della conversazione in Romancio almeno quanto il tempo meteorologico nella conversazione inglese.\nL\'argomento dell\' \"encreschadetgna\" non è nuovo. Ha radici profonde nella storia. Nelle regioni grigionesi di lingua romancia l\'economia rurale poteva sostenere soltanto un certo quantitativo di persone, e molta gente ha dovuto andarsene per lunghi periodi se non per sempre.\nN.B. L\'espressione verbale \"Laschas ti encrescher?\" (\"Hai nostalgia?\" - litteralmente: \"senti crescere in te una sensazione di nostalgia?\")\n(Vedi anche la nota in \"rondine\" o \"randulin(a)\".)', '', '', '', '', 2161),
