('', '', 0, 0, 0, 'Porta Alpina', 'Porta Alpina', 'num feminin', 'nome femminile', 'Porta Alpina', 'Porta Alpina', '(=RG)', 'Porta Alpina', '(=RG)', 'Porta Alpina', '(=RG)', 'Porta Alpina', '(=RG)', 'Porta Alpina', '(=RG)', 'Porta Alpina', 'NEAT, Port\'Alpina:\n\"NEAT\" è il più grande ed il più costoso progetto d\'ingegneria della storia svizzera. I nuovi tunnel attraverso le alpi serviranno ad aumentare enormemente le capacità di trasporto, accorciare significativamente la durata dei viaggi e (si spera) ridurre il volume di traffico sulle autostrade.\nIl Tunnel di base del Gottardo passerà sotto il Tujetsch (la parte della Surselva che si trova a maggior altitudine) ad una profondità di 800 m sotto il villaggio di Sedrun.\n\"Port\'Alpina\" è il nome dato ad una proposta di una stazione sotterranea, possibilità remota a causa di ragioni legate alla disponibilità finanziaria.', '', '', '', '', 4719),
