('', '', 0, 0, 0, 'vulair', 'vulair', 'verb', '', 'volere', 'volere', 'vuler', 'vuler', 'ler, vuler', 'ler, vuler, vi, lagn', 'leir, vuleir', 'leir, vuleir', 'vulair', 'vulair', 'vulair', 'vulair', 'Verbi romanci (1):\nVerbi irregolari:\nUno di questi è \"vulair\".\nClicca \"Dettagli\" per visualizzare la sua coniugazione completa.', '', '', 'VULAIR\n\nPreschent: \njau vi\nti vuls\nel/ella/ins vul\nnus vulain / nus lain\nvus vulais\nels/ellas vulan\n\nFutur:\njau vegn a vulair \nti vegns a vulair \nel/ella/ins vegn a vulair \nnus vegnin a vulair \nvus vegnis a vulair \nels/ellas vegnan a vulair\n\nImperfect: \njau vuleva / jau leva\nti vulevas\nel/ella/ins vuleva\nnus vulevan\nvus vulevas\nels/ellas vulevan \n\nParticip perfect: \nvulì (f: vulida mpl: vulids, fpl: vulidas)\n\nPerfect:\njau hai vulì\nti has vulì\nel/ella/ins ha vulì\nnus avain vulì\nvus avais vulì\nels/ellas han vulì\n\nCundiziunal: \njau vuless / jau less\nti vulessas\nel/ella/ins vuless\nnus vulessan\nvus vulessas\nels/ellas vulessan \n\nConjunctiv: \nche jau veglia\nche ti veglias\nch\'el/ella/ins veglia\nche nus veglian\nche vus veglias\nch\'els/ellas veglian \n\nImperativ: \nveglias!\nveglias! \n\nGerundi: \nvulend', '', 5501),
